import React from 'react'
import { Container } from 'react-bootstrap';

function Footer() {
    return (
        <div className="foooter-main">
            <Container></Container>
            <div>
                <img classname="zomato-image1" src="https://b.zmtcdn.com/web_assets/b40b97e677bc7b2ca77c58c61db266fe1603954218.png" alt="zom"></img>
            </div>
            
        </div>
    )
}

export default Footer
